import React from 'react';
import { Link } from 'react-router-dom';
import './HomePage.css';

function HomePage() {
  return (
    <div>
      <h2>Warehouse Management</h2>
      <Link to="/scan-goods">
        <button>Scan Goods</button>
      </Link>
      <Link to="/view-goods">
        <button>View Goods</button>
      </Link>
    </div>
  );
}

export default HomePage;
